// src/pages/admin/ExpensesPage.js
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './ExpensesPage.css';

const AdminExpensesPage = () => {
  const navigate = useNavigate();
  const [stats, setStats] = useState({
    totalExpenses: 250000,
    thisMonth: 67000,
    pendingApproval: 15000,
    approved: 235000,
    maintenance: 85000,
    utilities: 45000
  });
  const [expenses, setExpenses] = useState([]);
  const [filteredExpenses, setFilteredExpenses] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCategory, setSelectedCategory] = useState('All Categories');
  const [selectedStatus, setSelectedStatus] = useState('All Status');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const mockExpenses = [
      {
        id: 1,
        date: '1/10/2025',
        category: 'Maintenance',
        description: 'Elevator repair and servicing',
        vendor: 'ABC Elevators',
        amount: 25000,
        status: 'approved',
        invoice: 'INV001'
      },
      {
        id: 2,
        date: '8/10/2025',
        category: 'Cleaning',
        description: 'Cleaning supplies and equipment',
        vendor: 'CleanPro Supplies',
        amount: 8000,
        status: 'pending',
        invoice: 'INV002'
      },
      {
        id: 3,
        date: '15/10/2025',
        category: 'Utilities',
        description: 'Monthly electricity bill',
        vendor: 'City Power Company',
        amount: 15000,
        status: 'approved',
        invoice: 'INV003'
      },
      {
        id: 4,
        date: '20/10/2025',
        category: 'Security',
        description: 'Security guard monthly salary',
        vendor: 'SecureGuard Services',
        amount: 12000,
        status: 'approved',
        invoice: 'INV004'
      },
      {
        id: 5,
        date: '25/10/2025',
        category: 'Landscaping',
        description: 'Garden maintenance and plants',
        vendor: 'GreenThumb Landscaping',
        amount: 7000,
        status: 'pending',
        invoice: 'INV005'
      }
    ];

    setTimeout(() => {
      setExpenses(mockExpenses);
      setFilteredExpenses(mockExpenses);
      setLoading(false);
    }, 1000);
  }, []);

  const categories = ['All Categories', ...new Set(expenses.map(expense => expense.category))];
  const statuses = ['All Status', 'pending', 'approved'];

  useEffect(() => {
    let filtered = expenses;

    if (selectedCategory !== 'All Categories') {
      filtered = filtered.filter(expense => expense.category === selectedCategory);
    }

    if (selectedStatus !== 'All Status') {
      filtered = filtered.filter(expense => expense.status === selectedStatus);
    }

    if (searchTerm) {
      filtered = filtered.filter(expense =>
        expense.description.toLowerCase().includes(searchTerm.toLowerCase()) ||
        expense.vendor.toLowerCase().includes(searchTerm.toLowerCase()) ||
        expense.invoice.toLowerCase().includes(searchTerm.toLowerCase())
      );
    }

    setFilteredExpenses(filtered);
  }, [searchTerm, selectedCategory, selectedStatus, expenses]);

  const handleAddExpense = () => {
    alert('添加费用功能将在实际应用中实现');
  };

  const handleExport = () => {
    alert('导出功能将在实际应用中实现');
  };

  const handleUpdateStatus = (id, newStatus) => {
    const updatedExpenses = expenses.map(expense =>
      expense.id === id ? { ...expense, status: newStatus } : expense
    );
    setExpenses(updatedExpenses);
    alert(`费用 #${id} 状态已更新为 ${newStatus}`);
  };

  const formatAmount = (amount) => {
    return new Intl.NumberFormat('en-IN', {
      style: 'currency',
      currency: 'INR',
      minimumFractionDigits: 0
    }).format(amount);
  };

  return (
    <div className="admin-expenses-page">
      <div className="page-header">
        <button className="back-btn" onClick={() => navigate('/admin')}>
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#333">
            <path d="M20,11V13H8L13.5,18.5L12.08,19.92L4.16,12L12.08,4.08L13.5,5.5L8,11H20Z"/>
          </svg>
          Back to Dashboard
        </button>
        <h1>Expenses Management</h1>
        <p>Monitor and manage all society expenses</p>
      </div>

      {loading ? (
        <div className="loading-container">
          <div className="spinner"></div>
        </div>
      ) : (
        <>
          <div className="stats-grid">
            <div className="stat-card primary">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M19,3H14.82C14.4,1.84 13.3,1 12,1C10.7,1 9.6,1.84 9.18,3H5A2,2 0 0,0 3,5V19A2,2 0 0,0 5,21H19A2,2 0 0,0 21,19V5A2,2 0 0,0 19,3M12,3A1,1 0 0,1 13,4A1,1 0 0,1 12,5A1,1 0 0,1 11,4A1,1 0 0,1 12,3M7,7H17V5H19V19H5V5H7V7Z"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>Total Expenses</h3>
                <p className="stat-value">{formatAmount(stats.totalExpenses)}</p>
              </div>
            </div>

            <div className="stat-card warning">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2M12,4A8,8 0 0,1 20,12A8,8 0 0,1 12,20A8,8 0 0,1 4,12A8,8 0 0,1 12,4M12,6A6,6 0 0,0 6,12A6,6 0 0,0 12,18A6,6 0 0,0 18,12A6,6 0 0,0 12,6M12,8A4,4 0 0,1 16,12A4,4 0 0,1 12,16A4,4 0 0,1 8,12A4,4 0 0,1 12,8Z"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>This Month</h3>
                <p className="stat-value">{formatAmount(stats.thisMonth)}</p>
              </div>
            </div>

            <div className="stat-card info">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2M12,4A8,8 0 0,1 20,12A8,8 0 0,1 12,20A8,8 0 0,1 4,12A8,8 0 0,1 12,4M12,6A6,6 0 0,0 6,12A6,6 0 0,0 12,18A6,6 0 0,0 18,12A6,6 0 0,0 12,6M12,8A4,4 0 0,1 16,12A4,4 0 0,1 12,16A4,4 0 0,1 8,12A4,4 0 0,1 12,8Z"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>Pending Approval</h3>
                <p className="stat-value">{formatAmount(stats.pendingApproval)}</p>
              </div>
            </div>

            <div className="stat-card success">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2M12,4A8,8 0 0,1 20,12A8,8 0 0,1 12,20A8,8 0 0,1 4,12A8,8 0 0,1 12,4M11,16.5L6.5,12L7.91,10.59L11,13.67L16.59,8.09L18,9.5L11,16.5Z"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>Approved</h3>
                <p className="stat-value">{formatAmount(stats.approved)}</p>
              </div>
            </div>
          </div>

          <div className="page-actions">
            <button className="action-btn primary" onClick={handleAddExpense}>
              <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#fff">
                <path d="M19,13H13V19H11V13H5V11H11V5H13V11H19V13Z"/>
              </svg>
              Add New Expense
            </button>
            <button className="action-btn secondary" onClick={handleExport}>
              <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#fff">
                <path d="M14,2H6A2,2 0 0,0 4,4V20A2,2 0 0,0 6,22H18A2,2 0 0,0 20,20V8L14,2M18,20H6V4H13V9H18V20M12,19L8,15H10.5V12H13.5V15H16L12,19Z"/>
              </svg>
              Export to Excel
            </button>
          </div>

          <div className="expenses-container">
            <div className="container-header">
              <h2>All Expenses</h2>
              <div className="filter-controls">
                <input
                  type="text"
                  placeholder="Search expenses..."
                  className="search-input"
                  value={searchTerm}
                  onChange={(e) => setSearchTerm(e.target.value)}
                />
                <select
                  className="filter-select"
                  value={selectedCategory}
                  onChange={(e) => setSelectedCategory(e.target.value)}
                >
                  {categories.map(category => (
                    <option key={category} value={category}>{category}</option>
                  ))}
                </select>
                <select
                  className="filter-select"
                  value={selectedStatus}
                  onChange={(e) => setSelectedStatus(e.target.value)}
                >
                  {statuses.map(status => (
                    <option key={status} value={status}>
                      {status === 'All Status' ? status : status.charAt(0).toUpperCase() + status.slice(1)}
                    </option>
                  ))}
                </select>
              </div>
            </div>

            <div className="expenses-table-container">
              <table className="expenses-table">
                <thead>
                  <tr>
                    <th>Date</th>
                    <th>Invoice</th>
                    <th>Category</th>
                    <th>Description</th>
                    <th>Vendor</th>
                    <th>Amount</th>
                    <th>Status</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {filteredExpenses.length > 0 ? (
                    filteredExpenses.map(expense => (
                      <tr key={expense.id}>
                        <td>{expense.date}</td>
                        <td>{expense.invoice}</td>
                        <td>{expense.category}</td>
                        <td>{expense.description}</td>
                        <td>{expense.vendor}</td>
                        <td>{formatAmount(expense.amount)}</td>
                        <td>
                          <span className={`status-badge ${expense.status}`}>
                            {expense.status}
                          </span>
                        </td>
                        <td>
                          <div className="action-buttons">
                            {expense.status === 'pending' && (
                              <button 
                                className="approve-btn"
                                onClick={() => handleUpdateStatus(expense.id, 'approved')}
                              >
                                Approve
                              </button>
                            )}
                            <button className="view-btn">View</button>
                            <button className="edit-btn">Edit</button>
                          </div>
                        </td>
                      </tr>
                    ))
                  ) : (
                    <tr>
                      <td colSpan="8" className="no-data">No expenses found</td>
                    </tr>
                  )}
                </tbody>
              </table>
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default AdminExpensesPage;
